/*Table structure for table `cancelled_appointments` */

DROP TABLE IF EXISTS `cancelled_appointments`;

CREATE TABLE `cancelled_appointments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `appoinment_id` int(10) unsigned NOT NULL,
  `justification` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `cancelled_by_id` int(10) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `cancelled_appointments_appoinment_id_foreign` (`appoinment_id`),
  KEY `cancelled_appointments_cancelled_by_foreign` (`cancelled_by_id`),
  CONSTRAINT `cancelled_appointments_appoinment_id_foreign` FOREIGN KEY (`appoinment_id`) REFERENCES `appoinments` (`id`),
  CONSTRAINT `cancelled_appointments_cancelled_by_foreign` FOREIGN KEY (`cancelled_by_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

